import React, { Component } from 'react';
import MenuItems from './menuItems.js';
class Categoria extends Component{
    constructor(props){
        super(props);
        this.state = {
            visible:false
        }
    }
    render(){
        return (
            <li>
                <h3>{this.props.name}</h3>
                <ul>
                    {this.props.items.map}
                </ul>
            </li>
        );
    }
}

export default Categoria;
